import React from "react";
import ReactDOM from "react-dom";
import "./Button.css";

const Button = (props) => {
  return (
    <div
      style={{
        display: "inline-block",
        width: props.width,
        height: props.height,
      }}
    >
      <a href="" class="text" style={{ lineHeight: props.height }}>
        <img src={require("../images/resume.svg")} />
        {props.text}
      </a>
    </div>
  );
};

export default Button;
